import Link from "next/link";
import Layout from "../components/Layout";
import { subjects } from "../constant/constant";

export default () => {
  const Subs =subjects.map(d => {
    return  <Link> <h2>{d}</h2></Link>;
  });
  return (
    <Layout title="Choose Subjects">
      {/* <Link> */}
      <h2>Subject Wise</h2>
      {/* </Link> */}
      {Subs}
    </Layout>
  );
};
